import React, { useEffect, useState } from 'react';

function EventComparison({ points, gender, season }) {
  const [equivalentPerformances, setEquivalentPerformances] = useState({});

  useEffect(() => {
    if (points) {
      fetchEquivalentPerformances();
    }
  }, [points, gender, season]);

  const fetchEquivalentPerformances = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/calculate-performances', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          points: points,
          gender: gender,
          season: season,
        }),
      });

      const data = await response.json();
      setEquivalentPerformances(data.performances);
    } catch (error) {
      console.error('Error fetching equivalent performances:', error);
    }
  };

  if (!points) return null;

  return (
    <div className="event-comparison">
      <h2>Equivalent Performances</h2>

      <div className="event-section">
        <h3>Track Events</h3>
        <table>
          <tbody>
            {Object.entries(equivalentPerformances)
              .filter(([event]) => !event.includes('J') && !event.includes('T') && !event.includes('P'))
              .map(([event, performance]) => (
                <tr key={event}>
                  <td>{event}</td>
                  <td>{performance}</td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>

      <div className="event-section">
        <h3>Field Events</h3>
        <table>
          <tbody>
            {Object.entries(equivalentPerformances)
              .filter(([event]) => event.includes('J') || event.includes('T') || event.includes('P'))
              .map(([event, performance]) => (
                <tr key={event}>
                  <td>{event}</td>
                  <td>{performance}</td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default EventComparison;
